commits.content:
* {
    overflow: hidden;
}
body {
    color: black;
    /* background-image: url('background.jpg'); */
    background-size: cover;
}

.headContainer {
    display: flex;
    flex-direction: column;
    align-items: center;
}
.titleContainer {
    display: flex;
    flex-direction: row;
    justify-content: center;
    align-items: center;
}
.bodyContainer {
    max-width: 800px;
    margin: auto;
    padding-left: 3px;
    border: 1px solid black;
    margin-top: 10px;
}

.meaningParagraph {
    display: inline-block;
}

/* this helps to print the index and the meaning in same line */
.MainHeading {
    color: black;
}

.wordName {
    display: inline-block;
}
.playbutton {
    cursor: pointer;
    display: inline-block;
}

.buttons {
    display: flex;
    justify-content: center;
    margin-bottom: 3px;
}
.btn {
    margin: 0 2px 0 2px;
}
